description:
追求したのはコントロール性と快適な乗り心地。街乗りからサーキット走行まで適応しつつ、ストリートでの快適性を犠牲にしないBasicタイプ。反応はリニアで、コントロール性を追及したベーシックモデルとしてコストパフォーマンスにも優れ、かつハイオリティを実現した商品です。●フルタップ・全長調整式　●倒立式ショック(ストラットサス)　●リジットマウントタイプ　　<br><br>【アッパーマウント】フロント：固定式 リア：固定式　【仕様】フロント：正立式 リア：固定式　【スプリング】フロント：14kgf/ リア：10kgf/　　※商品画像はイメージです。実際の商品とは異なる場合があります。 <br><br>※ポップアップフード付き車のローダウンやインチアップなどによるフードの不具合につきましては一切の責任を負いかねます。　※車高はかなり下げることが出来ますが各車種のデータはございません。最低地上高9ｃｍを確保してご使用下さい。　※専用車種以外での使用は危険ですのでお避け下さい。ショック等のデータは一切お答え出来ません。　※仕様及びバネレートは予告なく変更する場合がございますのでご了承下さい。　※取付作業は必ず専門の業者・整備士の方に作業をして頂いて下さい。　※エアサス車 取付可。但し、車検非対応となります。（強度検討書はお出ししていません）※こちらの商品は代引き不可です。<br><br><br>対応車種：トヨタ セルシオ UCF30<br><br>足回り | 車高調キット<br>トヨタ | セルシオ | UCF30系<tr><td colspan="2">
